import React, { useState } from 'react';

import Square from "./square"

class Lawn extends React.Component {

  constructor(props) {
    super(props);
    this.state = { change: true };
  }

  renderSquare(i) {
    return (
        <div>
        <Square
           value={this.props.squares[i]}
        />
        <span>coucou {this.props.size}</span></div>
    );
  }
}

export default Lawn
